static __inline__
mp_limb_signed_t NMOD_DIVREM_BC_ITCH(mp_limb_signed_t lenA, mp_limb_signed_t lenB, nmod_t mod)
{
    const mp_limb_t bits =
        2 * (64 - mod.norm) + FLINT_BIT_COUNT(lenA - lenB + 1);

    if (bits <= 64)
        return lenA;
    else if (bits <= 2 * 64)
        return 2*(lenA + lenB - 1);
    else
        return 3*(lenA + lenB - 1);
}

static __inline__
mp_limb_signed_t NMOD_DIV_BC_ITCH(mp_limb_signed_t lenA, mp_limb_signed_t lenB, nmod_t mod)
{
    const mp_limb_t bits =
        2 * (64 - mod.norm) + FLINT_BIT_COUNT(lenA - lenB + 1);

    if (bits <= 64)
        return lenA - lenB + 1;
    else if (bits <= 2 * 64)
        return 2*lenA;
    else
        return 3*lenA;
}

static __inline__
mp_limb_signed_t NMOD_DIVREM_DC_ITCH(mp_limb_signed_t lenB, nmod_t mod)
{
    mp_limb_signed_t i = 0;

    while (lenB > 300 + i)
    {
        lenB = (lenB + 1)/2;
        i++;
    }
    if (lenB > 300)
        lenB = 300;

    return NMOD_DIVREM_BC_ITCH(2*lenB - 1, lenB, mod) + 2*lenB - 1;
}

