static __inline__ void
arb_get_abs_ubound_arf(arf_t u, const arb_t x, mp_limb_signed_t prec)
{
    arf_t t;
    arf_init_set_mag_shallow(t, (&(x)->rad));

    if (arf_sgn((&(x)->mid)) < 0)
        arf_sub(u, (&(x)->mid), t, prec, 1);
    else
        arf_add(u, (&(x)->mid), t, prec, 1);

    arf_abs(u, u);
}

static __inline__ void
arb_get_abs_lbound_arf(arf_t u, const arb_t x, mp_limb_signed_t prec)
{
    arf_t t;
    arf_init_set_mag_shallow(t, (&(x)->rad));

    if (arf_sgn((&(x)->mid)) > 0)
    {
        arf_sub(u, (&(x)->mid), t, prec, 1);
    }
    else
    {
        arf_add(u, (&(x)->mid), t, prec, 1);
        arf_neg(u, u);
    }

    if (arf_sgn(u) < 0)
        arf_zero(u);
}

